object Largest1BorderedSquare_1139 {
    fun largest1BorderedSquare(grid: Array<IntArray>): Int {
        val row = grid.size
        val col = grid[0].size
        val oneDim = Array(row) { Array(col) { IntArray(4) } }
        for (i in 0 until row) {
            for (j in 0 until col) {
                oneDim[i][j][0] = if (j == 0) grid[i][j]
                else if (grid[i][j] == 0) 0 else oneDim[i][j - 1][0] + 1
            }
            for (j in col - 1 downTo 0) {
                oneDim[i][j][1] = if (j == col - 1) grid[i][j]
                else if (grid[i][j] == 0) 0 else oneDim[i][j + 1][1] + 1
            }
        }

        for (j in 0 until col) {
            for (i in 0 until row) {
                oneDim[i][j][2] = if (i == 0) grid[i][j]
                else if (grid[i][j] == 0) 0 else oneDim[i - 1][j][2] + 1
            }
            for (i in row - 1 downTo 0) {
                oneDim[i][j][3] = if (i == row - 1) grid[i][j]
                else if (grid[i][j] == 0) 0 else oneDim[i + 1][j][3] + 1
            }
        }
        val leftUp = Array(row) { IntArray(col) }
        val rightDown = Array(row) { IntArray(col) }
        for (i in 0 until row) {
            for (j in 0 until col) {
                rightDown[i][j] = minOf(oneDim[i][j][0], oneDim[i][j][3])
                leftUp[i][j] = minOf(oneDim[i][j][1], oneDim[i][j][2])
            }
        }
        var result = 0
        for (i in 0 until row) {
            for (j in 0 until col) {
//                println("[$i,$j]")
                if (rightDown[i][j] > 0) {
                    result = maxOf(
                        result,
                        minOf(
                            rightDown[i][j], leftUp[i + rightDown[i][j] - 1][j - rightDown[i][j] + 1]
                        )
                    )
                    println("[$i,$j]  ---> $result")

                }
//                println(result)
                if (leftUp[i][j] > 0) {
                    result = maxOf(
                        result,
                        minOf(
                            leftUp[i][j], rightDown[i - leftUp[i][j] + 1][j + leftUp[i][j] - 1]
                        )
                    )
                    println("[$i,$j]  ---> $result")

                }
//                println(result)

            }
        }
        return result * result
    }
}

